# https://leetcode.com/problems/maximum-score-from-grid-operations/
# This solution gives TLE on leetcode, hence not most optimised
from typing import List


class Solution:
    def maximumScore(self, grid: List[List[int]]) -> int:
        def createSumCol():
            sumCol = [[[0 for _ in range(r)] for _ in range(r)] for _ in range(c)]
            for i in range(c):
                sumArr = [0 for _ in range(r)]
                for j in range(r):
                    if j == 0:
                        sumArr[j] = grid[0][i]
                        continue
                    else:
                        sumArr[j] = grid[j][i] + sumArr[j - 1]
                for start in range(r):
                    for end in range(start, r):
                        sumCol[i][start][end] = sumArr[end] - sumArr[start - 1] if start > 0 else sumArr[end]
            return sumCol

        def getSumCol(col, start, end):
            if start < 0 or end < 0:
                return 0
            if start >= r or end >= r:
                return 0
            if start > end:
                return 0
            return sumCol[col][start][end]

        r = len(grid)
        c = len(grid[0])

        if c < 2:
            return 0

        sumCol = createSumCol()

        dp = [[[0 for _ in range(r + 1)] for _ in range(r + 1)] for _ in range(c)]

        ans = 0

        for i in range(r + 1):
            for j in range(r + 1):
                if i == j:
                    dp[c - 2][i][j] = 0
                elif i > j:
                    dp[c - 2][i][j] = getSumCol(c - 1, j, i - 1)
                else:
                    dp[c - 2][i][j] = getSumCol(c - 2, i, j - 1)
                ans = max(ans, dp[c - 2][i][j])

        for col in range(c - 3, -1, -1):
            for i in range(r + 1):
                for j in range(r + 1):
                    max_ans = 0
                    nowCol = getSumCol(col, i, j - 1)
                    for k in range(r + 1):
                        pColExtra = 0
                        if i > max(j, k):
                            pColExtra = getSumCol(col + 1, max(j, k), i - 1)
                        max_ans = max(max_ans, nowCol + pColExtra + dp[col + 1][j][k])
                    ans = max(ans, max_ans)
                    dp[col][i][j] = max_ans

        return ans


